// SPDX-License-Identifier: MIT
pragma solidity 0.8.1;

import "@openzeppelin/contracts/utils/Counters.sol";
import "./RenntrancyGuard.sol";

interface GeekNftInterface{
    function transferFrom(address _from, address _to, uint _tokenId) external;
}

contract GeekNftMarketPlace is ReentrancyGuard {
    using Counters for Counters.Counter;

    Counters.Counter private _nftsSold;
    Counters.Counter private _nftsCount;

    uint public LISTING_FEE = 0.002 ether;
    address payable private _marketOwwner;

    mapping(uint => NFT) private _idToNft;

    struct NFT {
        address nftContract;
        uint tokenId;
        uint price;
        address payable seller;
        address payable owner;
        address payable creator;
        bool listed;
    }

    event NFTListed(address nftContract, uint tokenId, address indexed seller, address indexed owner, uint price);
    event NFTSold(address nftContract, uint tokenId, address indexed seller, address indexed owner, uint price);

    constructor() {
        _marketOwwner = payable(msg.sender);
    }

    // list the nft on the marketplace
    function listNFT(address _nftContract, uint _tokenId, uint _price) public payable nonReentrant{
        require(_price > 0, "Price must be at least 1 wei");
        require(msg.value == LISTING_FEE, "Not enough ether for listing fee");

        GeekNftInterface(_nftContract).transferFrom(msg.sender, address(this), _tokenId);
        _nftsCount.increment();

        _idToNft[_tokenId] = NFT(
            _nftContract,
            _tokenId,
            _price,
            payable(msg.sender),
            payable(address(this)),
            payable(msg.sender),
            true
        );

        _marketOwwner.transfer(msg.value);

        emit NFTListed(_nftContract, _tokenId, msg.sender, address(this), _price);
    }

    // buy an nft
    function buyNft(address _nftContract, uint _tokenId) public payable nonReentrant{
        NFT storage nft = _idToNft[_tokenId];
        require(msg.value >= nft.price, "Not enough ether to cover asking price");

        address payable buyer = payable(msg.sender);
        nft.seller.transfer(msg.value);

        GeekNftInterface(_nftContract).transferFrom(address(this), buyer, _tokenId);
        nft.owner = buyer;
        nft.listed = false;

        _nftsSold.increment();

        emit NFTSold(_nftContract, _tokenId, nft.seller, buyer, msg.value);
    }

    // resell nft purchased from the marketplace
    function resellNFT(address _nftContract, uint _tokenId, uint _price) public payable nonReentrant{
        require(_price > 0, "Price must be at least 1 wei");
        require(msg.value == LISTING_FEE, "Not enough ether for listing fee");

        GeekNftInterface(_nftContract).transferFrom(msg.sender, address(this), _tokenId);

        NFT storage nft = _idToNft[_tokenId];
        nft.seller = payable(msg.sender);
        nft.owner = payable(address(this));
        nft.listed = true;
        nft.price = _price;

        _nftsSold.decrement();

    }
}

